    StudentIndexComponent.prototype.change = function (event, cor) {
        var _this = this;
        this.studentService.getCoursePrice(cor.level_id).subscribe(function (res) {
            _this.priceMatrial2 = res;
            if (event.target.checked === true) {
                if (_this.counter <= _this.numberLimit) {
                    _this.totalpay2 += _this.priceMatrial2.price_material;
                    _this.totalbook2 += _this.priceMatrial2.book_price;
                    _this.totalBook_Mat2 = _this.totalpay2 + _this.totalbook2;
                    _this.idsmat2.push(cor.id);
                    _this.namecourse.push(cor.name);
                }
                else {
                    event.target.checked = false;
                    _this.display4 = 'block';
                    _this.valepa2 = "";
                }
            }
            else {
                if (_this.counter > 0) {
                    _this.counter--;
                    _this.totalpay2 -= _this.priceMatrial2.price_material;
                    _this.totalbook2 -= _this.priceMatrial2.book_price;
                    _this.totalBook_Mat2 = _this.totalpay2 + _this.totalbook2;
                    var index = _this.idsmat2.findIndex(function (element) { return element == cor.id; });
                    _this.idsmat2.splice(index, 1);
                    // let index2 = this.namecourse.find((element) => element  === cor.name);
                    // this.namecourse.splice(index2, 1);
                    _this.namecourse.forEach(function (value, index) {
                        if (value == cor.name)
                            _this.namecourse.splice(index, 1);
                    });
                }
            }
        });
    };
